import React, { useState } from 'react';

const Login: React.FC = () => {
  const [username, setUsername] = useState('');
  const [parola, setParola] = useState('');

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    alert(`Autentificat ca ${username}!`);
  };

  return (
    <div
      className="min-h-screen bg-cover bg-center flex items-center justify-center p-6"
      style={{ backgroundImage: "url('/images/background-casino.jpg')" }}
    >
      <div className="max-w-md w-full bg-black bg-opacity-70 rounded-md shadow-md p-6 text-white">
        <h1 className="text-2xl font-bold mb-6 text-center">Autentificare</h1>
        <form onSubmit={handleSubmit} className="space-y-4">
          <input
            type="text"
            placeholder="Username"
            className="w-full p-2 rounded bg-gray-800 border border-gray-700 text-white"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
          />
          <input
            type="password"
            placeholder="ParolÄƒ"
            className="w-full p-2 rounded bg-gray-800 border border-gray-700 text-white"
            value={parola}
            onChange={(e) => setParola(e.target.value)}
            required
          />
          <button
            type="submit"
            className="w-full bg-blue-600 py-2 rounded hover:bg-blue-700"
          >
            Autentificare
          </button>
        </form>
      </div>
    </div>
  );
};

export default Login;
